import '../App.css';
import Button from 'react-bootstrap/Button';

function Home() {
  return (
    <div>
        <header className='Home-header'>
            <h3 style={{marginLeft: 100}}>Транспонатор нот</h3>
            <div>
                <Button>Вход</Button>
                <Button style={{marginLeft: 15, marginRight: 100}}>Регистрация</Button>
            </div>
        </header>
    </div>
  );
}

export default Home;
